import React from 'react'
import {Link} from "react-router-dom";

export const Problems = () => {
  return (
    <div>
        <li>
                    <Link to="/AddEditProblems"> Add new Problems  </Link>
                </li>
      <p>Sample Problem 1</p>
      <button>Edit</button>
      <button>Delete</button>
    </div>
  )
}

export default Problems
